  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Ernest F. Hollings Ace Basin NWR for the next
  15 years. This plan outlines the Refuge vision and purpose and describes how Ernest
  F. Hollings Ace Basin NWR will contribute to the overall mission of the Refuge System.
  The plan provides an introduction to the Refuge, an overview of the CCP process,
  information about the management direction, strategies for implementation, and consultation.
  Key planning issues include: wildlife management, habitat management, resource protection,
  visitor services, and Refuge administration.\",\n\t\"license_title\": \"License
